import styled from "styled-components";

export const CardsWrapper = styled.div`
  height: 660px;
`;

export const Cards = styled.div`
  display: flex;
  flex-wrap: wrap;
  margin-top: 30px;
  margin-bottom: 30px;
  margin-left: 15px;
`;

export const ListOfCards = styled.ul`
  height: 100%;
  width: 70%;
  display: flex;
  flex-wrap: wrap;
`;
